#######################
# HILFSFUNKTIONEN
#######################

def lookup_elster_index(elster_index):
    """
    Gibt Dict-Eintrag mit (Name, Type, EnglishName) f√ºr den Elster-Index zur√ºck.
    """
    if elster_index in ELSTER_TABLE:
        return ELSTER_TABLE[elster_index]
    else:
        # Fallback: unbekannter Index
        return {
            "Name": f"Unknown_0x{elster_index:04X}",
            "Type": "et_default",
            "EnglishName": "UNKNOWN"
        }

def interpret_elster_value(raw_val, elster_type):
    """
    Interpretiert den 16-Bit raw_val anhand der Type-Information (z.B. et_dec_val).
    """
    if elster_type == "et_dec_val":
        # 1 Nachkommastelle => raw_val / 10
        return raw_val / 10.0
    elif elster_type == "et_cent_val":
        return raw_val / 100.0
    elif elster_type == "et_mil_val":
        return raw_val / 1000.0
    elif elster_type == "et_bool":
        return bool(raw_val)
    elif elster_type == "et_little_bool":
        return (raw_val != 0)
    elif elster_type == "et_betriebsart":
        if raw_val in BETRIEBSART_LIST:
            return BETRIEBSART_LIST[raw_val]
        else:
            return f"UNBEKANNTE_BETRIEBSART(0x{raw_val:04X})"
    elif elster_type == "et_little_endian":
        lo = (raw_val & 0x00FF)
        hi = (raw_val & 0xFF00) >> 8
        return (lo << 8) | hi
    elif elster_type in ("et_time_domain", "et_zeit"):
        hh = (raw_val & 0xFF00) >> 8
        mm = (raw_val & 0x00FF)
        return f"{hh:02d}:{mm:02d}"
    else:
        return raw_val

